import React, {Component} from 'react'
import {connect} from 'react-redux'
import ArticleUI from './components/article'
import Board from './components/board'
import {
    HomeWrap,
    HomeBanner,
    HomeLeft,
    HomeRight,
    HomeListUL,
} from './style'
class Home extends Component{
    render(){
        return (
            <HomeWrap>
                <HomeLeft>
                    <HomeBanner>
                        <img className='img' src="https://upload.jianshu.io/admin_banners/web_images/4961/ea413556816bcb28b89c0dd27bd1cf5a5dda595b.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/1250/h/540" />
                    </HomeBanner>
                    <HomeListUL>
                       <ArticleUI />
                    </HomeListUL>
                </HomeLeft>
                <HomeRight>
                    
                </HomeRight>
            </HomeWrap>
        )
    }
}
export default connect(null, null)(Home)
